import axios from "axios"
import React from "react"
import {useState} from "react"
import Axios from "axios"

function Search(){
    const [viewTable,setViewTable] = useState([])
    const [start,setStart] = useState()
    const [isStartClicked,setStartClicked] = useState(false)

    var byStart = function(){
        setStartClicked(!isStartClicked)
        console.log(isStartClicked)
    }

    const Search_start = function(){
        Axios.post("http://localhost:1000/start",{
        start:start}).then((response) => {
            setViewTable(response.data)
        })
    }

    const Start = function(){
        return(<div><label>Enter the Starting Place</label><input type="text" onChange={(event) => {setStart(event.target.value)}}/></div>)
    }

    return(
        <div className="Button">
            <button class="btn btn-primary" onClick={byStart}>Search by Start</button>
            {isStartClicked && <Start/>}
            {Search_start}
            <table>
                  <tr>
                   <th>Booking_ID</th>
                   <th>Name</th>
                   <th>Age</th>
                   <th>Gender</th>
                   <th>Starting From</th>
                   <th>Verification_ID</th>
                  </tr>
            </table>
            {viewTable.map((val,key) => {
           return(
                    <tr>
                    <td>{val.booking_id}</td>
                    <td>{val.name}</td>
                    <td>{val.age}</td>
                    <td>{val.gender}</td>
                    <td>{val.start_place}</td>
                    <td>{val.verification_id}</td>
                  </tr> 
           )
       })}</div>
            

    )
}

export default Search
